import React from 'react'
import './navbar.scss'
import resume from "./data/Shivam Resume 2021.pdf"
import{Link} from "react-scroll";
import { motion } from "framer-motion";
import {useState} from 'react';
// import "bootstrap/dist/css/bootstrap.min.css"
// import "shards-ui/dist/css/shards.min.css"

function Navbar({toggler}) {


    const [clicked, setClicked] = useState(false);

    return (
        <div className="navbar">
            <div className="navbar-left">
            <h1><a className="logo" href="/"><span>Shivam</span><span>Patel</span></a></h1>

            {/* <button onClick={toggler}>dark</button> */}
            </div>
            <div className="navbar-right">
                <ul className="links">
                <Link
            activeClass="active"
            to="portfolio"
            spy={true}
            offset={-30}
            smooth={true}
            duration={500}
            onClick={() => setClicked(!clicked)}
          >
            <li>
              <motion.a
                whileHover={{ scale: 1.1 }}
                className="btn btn-med word"
              >
                portfolio
              </motion.a>
            </li>
          </Link>
          <Link
            activeClass="active"
            to="about-me-app"
            spy={true}
            offset={-30}
            smooth={true}
            duration={500}
            onClick={() => setClicked(!clicked)}
          >
            <li>
              <motion.a
                whileHover={{ scale: 1.05 }}
                className="btn btn-med word"
              >
                about me
              </motion.a>
            </li>
          </Link>
          <Link
            activeClass="active"
            to="contact-me-app"
            spy={true}
            offset={-30}
            smooth={true}
            duration={500}
            onClick={() => setClicked(!clicked)}
          >
            <li>
              <motion.a
                whileHover={{ scale: 1.05 }}
                className="btn btn-med word"
              >
                contact
              </motion.a>
            </li>
          </Link>
                </ul>
                <a className="hbtn hb-border-bottom-br2" href={resume} target="_blank" rel="noopener noreferrer">resume</a>
                {/* <button onClick={toggler}>dark</button> */}
            </div>
        </div>
    )
}

export default Navbar;
